import styled from "styled-components"

export default function Category(ion) {
    return(
        <div>
            {ion}
        </div>
    );
}
const Classe = styled.div`

    ion-icon {
        font-size: 30px;
        border-radius: 50%;
        background-color: #FFFFFF;
        color: #B3B3C3;
    }
`;
